import React from "react";
import Footer from "../../components/Footer";
import Header from "../../components/Header";

import {
  ContainerBook,
  ContainerInfosBook,
  InputChangeImage,
  ContainerInputs,
  ContainerButtonLogin,
  InputEditBook,
  ContainerButtonAdd,
  ButtonSubmitLogin,
} from "./styles";

const Login = () => {

  function login(e) {
    //previne reload à pagina
    e.preventDefault();
    console.log("add book");
  }

  return (
    <>
      <Header />
      <ContainerBook>
        <ContainerInfosBook onSubmit={login}>
          <ContainerInputs>
            <InputChangeImage
              name="imageBook"
              type="text"
              placeholder="book cover url"
              id="add_book_cover"
            />
            <InputEditBook
              name="titleBook"
              placeholder="Book title"
              type="text"
              id="add_book_title"
              required
            />
          </ContainerInputs>
          <ContainerButtonLogin>
            <ButtonSubmitLogin>Add</ButtonSubmitLogin>
          </ContainerButtonLogin>
        </ContainerInfosBook>
      </ContainerBook>
      <Footer />
    </>
  );
};

export default Login;
